import logo from './logo.svg';
import{ BrowserRouter, Routes, Route } from "react-router-dom"
import './App.css';
import Home from './pages/Home/Home';
Home
function App() {
  return (
    <>
        <BrowserRouter>
           <Routes>
              <Route path="/" element=
              {<Home />} />
           </Routes>
        </BrowserRouter>
    </>
  );
}

export default App;
